import './Styles/App.css';
import Navbar from './Components/Navbar';
import {BrowserRouter as Router, Switch, Route  } from 'react-router-dom';

function App() {
  return (
    <div className = "App">
      <Router>
        <Navbar/>
        <Switch>
         <Route path='/' />
        </Switch>
      </Router>
        Hola
    </div>
  );
}

export default App;
